import React from "react"

class Trial extends React.Component{
    render(){
        //render adalah fungsi untuk menampilkan elemen ini
        return(
            <div>
                <h3>{this.props.title}</h3>
                <small></small>
            </div>
        )
    }
}
export default Trial
